function App() {
  return (
    <Router>
      <div className="App">
        <Header />
        <Route path="/" component={Feed} exact />
        <Route path="/profile" component={Profile} exact />
        <Route path="/MYPOSTS" component={Myposts} exact />
      </div>
    </Router>
  );
}

export default App;
